from typing import *

class Solution:
    def freqAlphabets(self, s: str) -> str:
        '''
        1309. Decrypt String from Alphabet to Integer Mapping
        https://leetcode.com/contest/weekly-contest-170/problems/decrypt-string-from-alphabet-to-integer-mapping/
        '''
        replace: List[Tuple[Str, Str]] = [
            ("10#", "j"),
            ("11#", "k"),
            ("12#", "l"),
            ("13#", "m"),
            ("14#", "n"),
            ("15#", "o"),
            ("16#", "p"),
            ("17#", "q"),
            ("18#", "r"),
            ("19#", "s"),
            ("20#", "t"),
            ("21#", "u"),
            ("22#", "v"),
            ("23#", "w"),
            ("24#", "x"),
            ("25#", "y"),
            ("26#", "z"),
            ("1", "a"),
            ("2", "b"),
            ("3", "c"),
            ("4", "d"),
            ("5", "e"),
            ("6", "f"),
            ("7", "g"),
            ("8", "h"),
            ("9", "i"),
        ]
        for s1, s2 in replace:
            s = s.replace(s1, s2)
        return s


    def xorQueries(self, arr: List[int], queries: List[List[int]]) -> List[int]:
        '''
        5304. XOR Queries of Subarray
        https://leetcode.com/problems/xor-queries-of-a-subarray/
        '''
        cache = [0] * (len(arr) + 1)
        v = cache[0] = 0
        for i in range(0, len(arr)):
            v = cache[i + 1] = v ^ arr[i]

        return [cache[i] ^ cache[j + 1] for i, j in queries]

    def xorQueriesx(self, arr: List[int], queries: List[List[int]]) -> List[int]:
        cache = {}
        def xors(a, b):
            if (a, b) in cache:
                return cache[(a, b)]
            # print(f"xors({a=}, {b=})")
            for aa, bb in sorted(list(cache.keys()), key=lambda p: -(p[1] - p[0])):
                if bb < a or b < aa:
                    continue
                # print(f"({aa=}, {bb=})")
                if a == b:
                    val = arr[a]
                    if (a, b) not in cache:
                        cache[(a, b)] = val
                    return val
                elif a == aa and bb == b:
                    return cache[(aa, bb)]
                elif a == aa and bb <= b:
                    val = cache[(aa, bb)] ^ xors(bb + 1, b)
                    if (a, b) not in cache:
                        cache[(a, b)] = val
                    return val
                elif a <= aa and bb == b:
                    val = xors(a, aa - 1) ^ cache[(aa, bb)]
                    if (a, b) not in cache:
                        cache[(a, b)] = val
                    return val
                elif a <= aa and bb <= b:
                    val = xors(a, aa - 1) ^ cache[(aa, bb)] ^ xors(bb + 1, b)
                    if (a, b) not in cache:
                        cache[(a, b)] = val
                    return val
            val = arr[a]
            for i in range(a + 1, b + 1):
                val = val ^ arr[i]
            # print(f"{a=}, {b=}, {val=}")
            if (a, b) not in cache:
                cache[(a, b)] = val
            return val

        for a, b in sorted(queries, key=lambda p: p[0]):
            xors(a, b)

        answer = []
        for a, b in queries:
            answer.append(cache[(a, b)])
            # print(f"{cache=}")
        return answer


